import React, { useState } from "react";
import Chart from "../../components/chart/Chart";
import FeaturdInfo from "../../components/featuredInfo/FeaturedInfo";
import './dashboard.css'
import WidgetLg from "../../components/widgets/widgetLg/WidgetLg";
import WidgetSm from "../../components/widgets/widgetSm/WidgetSm";
import WidgetCol from "../../components/widgets/widgetCol/WidgetCol";

export default function Dashboard() {
    const location = useLocation();
    const [keyword, setKeywrod] = useState("wellness");

    return (
        <div className="dashboard">
            <div className="Widgets">
                <FeaturdInfo />
            </div>
            <div classname="chart-container">
                <input 
                  type="text"
                  placeholder="키워드 입력"
                  value={keyword}
                  onChange={(e) => setKeywrod(e.target.value)}
                  className="keyword-input"
                />
                <Chart keywrod={keyword} />
            </div>
            <div className="row">
                <WidgetSm />
                <WidgetLg />
            </div>
            <div className="col">
                <WidgetCol />
            </div>
        </div>
    )
}
